(defn eng-name-to-file-name [s]
  (-> s
      (string/replace " " "-")
      (string/replace "," "")
      (string/replace "é" "e")
      (string/replace "å" "a")
      (string/replace "ô" "o")
      (string/replace "’" "")
      string/lower-case))


(defn ldata []
  (let [data (json/parse-string (slurp "/media/ssd/sibental/playground-data/MODULES V8 GENERATION/modules-8.1.0.json") true)
        data (:locales data)
        data (map (fn [[_ item]]
                    [(eng-name-to-file-name (:eng-name item)) item]) data)
        data (sort-by first data)
        data (into {} data)]
    data))

(defn ks []
  (let [ks (keys data)
        ks (filter (fn [s]
                     (not (re-matches #"[a-z\(\)-\.]+" s)))
                   ks)]
    ks))